INSERT INTO `iland4_bat_dong_san_vi` VALUES (1056,'BCL1','Cần bán đất ở Nghi Khánh, Cửa Lò',17,'Đất nền dự án',1,'Cần Bán',2,'Sổ đỏ',1,'m2',1,'VND',NULL,NULL,NULL,NULL,NULL,48,'Nghệ An',352,'Cửa Lò',463,0,'','',NULL,3,'Hướng Đông',NULL,NULL,NULL,NULL,'<span id=\"ctl00_cphContent_lblUtility\" class=\"textBold\">Đất có bìa đỏ \r\ndiện tích 148.5m2/1lô, Hướng đông. Đường trước lô đất rộng 12m,  hướng \r\nmặt tiền rộng 5.50m/1 lô, đất  quy hoạch, cơ sở hạ tôt gần với biển và \r\ncảng (có hai bìa tách biệt).\r\nÐất vị trí đẹp thuận lợi cho việc đi lại, không gian yên tĩnh.</span>','7500000',1,4,1,1,1310517108,NULL,NULL,62,'TECCOREALS','C1 Quang Trung, Thành phố Vinh, Nghệ An','0383586587',NULL,'','Bán đất Cửa Lò','Đất Cửa Lò','Bán đất ở thị xã Cửa Lò, tỉnh Nghệ An','18.668819','105.67199700000003',148,NULL,NULL,NULL,0,0,148,5.5,27,'Cần Bán Đất nền dự án Đường nội bộ 12m, Nghi Khánh, Cửa Lò, Nghệ An',NULL,0,0,0,0,NULL,NULL,'','Nghi Khánh','Đường nội bộ 12m','1113750000',NULL,12,0,0,0,1,NULL,0),(1057,'BV2','Bán đất 2 mặt đường, hướng Đông Nam và Tây phường Bến Thủy',11,'Đất thổ cư',1,'Cần Bán',2,'Sổ đỏ',1,'m2',1,'VND',NULL,NULL,NULL,NULL,NULL,48,'Nghệ An',367,'Thành phố Vinh',78,37,'S.19, ngõ 9','1-2,1-5,2-6,2-9,',NULL,1,'Hướng Đông Nam',NULL,NULL,NULL,NULL,'<div style=\"text-align: justify;\" mce_style=\"text-align: justify;\"><span class=\"tinnong\">Gia đình có nhu cầu bán nhanh lô đất để chuyển đi \r\nHà Nội, với vị trí đẹp hai mặt tiền (đường 7m), xe oto có thể đi vào/ra \r\nbằng 2 đường không phải quay đầu xe diện tích hơn 300m2, có thể tách bìa\r\n làm hai lô để làm biệt thự, nhà vườn (chủ nhà sẽ thực hiện nếu có nhu \r\ncầu). Đất sổ đỏ chính chủ đã ở hơn 30 năm. Đất nằm trong khu CBCNV với \r\ntrình độ dân trí cao, tình hình an ninh trật tự tốt là khối văn hóa \r\nnhiều năm liền. Gần trường mẫu giáo và cấp 1,2 Bến thủy và gần Cấp 3 Lê \r\nViết thuật, có chợ và nằm cạnh UBND Phường Bến Thủy...giá khoảng 11.5 \r\ntriệu đồng/m2 (có thể thương lượng theo từng thời điểm. Nếu có nhu cầu \r\nxin liên hệ trực tiếp địa chỉ hoặc số điện thoại: 0983457949 0903238949 \r\nhoặc 01252529006 \r\nNếu có nhu cầu xin liên hệ trực tiếp địa chỉ hoặc số điện thoại: \r\n0983457949 0903238949 hoặc 01252529006\r\n</span></div>','11500000',1,11,1,1,1310519203,NULL,NULL,62,'0983457949','Ngõ 9 hoặc 11, số 19, Hoàng Thị Loan, Khối 4, Phường Bến Thủy, Tp Vinh','01252529006',NULL,'0903238949','Bán đất thành phố Vinh','Nhà đất Vinh','Bán đất tại thành phố Vinh, tỉnh Nghệ An','18.664590584235178','105.70306770922855',315,NULL,NULL,NULL,0,0,315,11,29,'Cần Bán Đất thổ cư S.19, ngõ 9 Hoàng Thị Loan, Bến Thủy, Thành phố Vinh, Nghệ An',NULL,0,0,0,0,NULL,NULL,'','Bến Thủy','Hoàng Thị Loan','3668500000',NULL,29,0,0,0,2,NULL,0),(1058,'BV3','Bán đất ở xã Hưng Lộc, diện tích rộng xây biệt thự',11,'Đất thổ cư',1,'Cần Bán',2,'Sổ đỏ',2,'Nguyên căn',1,'VND',NULL,NULL,NULL,NULL,NULL,48,'Nghệ An',367,'Thành phố Vinh',89,0,'Gần UBND xã','1-2,1-5,',NULL,4,'Hướng Tây Nam',NULL,NULL,NULL,NULL,'<span class=\"tinnong\">Phù \r\nhợp với những ai có ý định xây một căn biệt thự càn có khuôn viên đẹp, \r\ngiá cả hợp lý, diện tích rộng rãi thoải mái, gần chợ, trường học, bệnh \r\nviện.</span>\r\n                          \r\n                          \r\n                            Diện tích 527m2 (17x31), mặt đường nhựa 11m gần UBND xã Hưng Lộc. Đất bìa đỏ chính chủ','2700000000',1,15,1,1,1310769030,NULL,NULL,62,'0914.877.377','Số 45 - Đường Quang Trung - Thành phố Vinh - Nghệ An','0914.877.377',NULL,'','Bán đất Hưng Lộc','Bán đất Hưng Lộc','Bán đất Hưng Lộc Tp Vinh','18.668819','105.67199700000003',527,NULL,NULL,NULL,0,0,527,17,31,'Cần Bán Đất thổ cư Gần UBND xã Hưng Lộc, Thành phố Vinh, Nghệ An',NULL,0,0,0,0,NULL,NULL,'','Hưng Lộc','','2700000000',NULL,44,0,0,0,1,NULL,1),(1059,'BV4','Cần bán đất dự án ở Nghi Kim',17,'Đất nền dự án',1,'Cần Bán',2,'Sổ đỏ',1,'m2',1,'VND',NULL,NULL,NULL,NULL,NULL,48,'Nghệ An',367,'Thành phố Vinh',95,0,'Đường nội bộ 12m,','2-6,2-9,',NULL,6,'Hướng Tây',NUL