ăn Cừ, Hưng Bình, Thành phố Vinh, Nghệ An',NULL,0,0,0,0,NULL,NULL,'','Hưng Bình','Nguyễn Văn Cừ','4290000000',NULL,29,0,0,0,1,NULL,0),(1062,'BV6','Bán nhà, đất tại khối 7, phường Hà huy Tập, TP Vinh',2,'Nhà tạm',1,'Cần Bán',2,'Sổ đỏ',2,'Nguyên căn',1,'VND',NULL,NULL,NULL,NULL,NULL,48,'Nghệ An',367,'Thành phố Vinh',82,38,'Ngõ 1, Khối 7','1-5,2-6,2-9,',NULL,7,'Hướng Nam',NULL,NULL,NULL,NULL,'Nhà, đất tại Ngõ 1- Khối 7 - P.Hà Huy Tập- TP Vinh. Trong khu tập thể  \r\ngiáo viên trường PTTH Dân Tộc Nội trú Nghệ An. Diện tích mặt tiền 8,4m *\r\n  dài 16m= 134m2. hiện đang ở, có nhà mái bằng  xây dựng kiên cố, nội  \r\nthất đẹp 2 P ngủ, 1 P khách, 1 P ăn, 1 bếp + công trình phụ. hướng Nam, \r\n đường bê tông 3m, ô tô đỗ cửa, cách đường nhựa Hoàng Văn Thụ 150m , \r\nđiện  nước, an ninh tốt, sổ đỏ chính chủ. Miễn trung gian , giá bán 1,6 \r\ntỷ  VND có thương lượng. Liên hệ : A Tuấn : DT: 0906041488','1600000000',1,22,0,1,1311192906,NULL,NULL,62,'A Tuấn','Hà Huy Tập, Tp Vinh, Nghệ An','0906041488',NULL,'Liên hệ chính chủ, miễn trung gian','Bán nhà, đất tại khối 7, phường Hà huy Tập, TP Vinh','Bán nhà, đất tại khối 7, phường Hà huy Tập, TP Vinh','Bán nhà, đất tại khối 7, phường Hà huy Tập, TP Vinh','18.668819','105.67199700000003',134,NULL,NULL,NULL,0,0,134,8,16,'Cần Bán Nhà tạm Ngõ 1, Khối 7 Hoàng Văn Thụ, Hà Huy Tập, Thành phố Vinh, Nghệ An',NULL,0,0,0,0,NULL,NULL,'','Hà Huy Tập','Hoàng Văn Thụ','1600000000',NULL,51,0,0,0,1,NULL,0),(1063,'BV7','Bán đất 21m mặt đường Hà Huy Tập',11,'Đất thổ cư',1,'Cần Bán',2,'Sổ đỏ',1,'m2',1,'VND',NULL,NULL,NULL,NULL,NULL,48,'Nghệ An',367,'Thành phố Vinh',82,0,'','1-4,',NULL,4,'Hướng Tây Nam',NULL,NULL,NULL,NULL,'<p>Cần bán nhà để định cư ở nước ngoài, mặt tiền bám đường Hà Huy Tập rộng 21m, chiều sâu 11m, ngay gần ngã tư giao với đường Nguyễn Sỹ Sách. Rất thuận lợi để làm văn phòng, showroom, kinh doanh, siêu thị...</p><p>Đất ở khu vực đông dân, gần Trường CĐ Kinh tế Nghệ An, gần trường PTTH Nguyễn Trường Tộ, trường C2 Hà Huy Tập... Gần chợ Cầu kênh Bắc<br></p><p>Giá bán: 45 triệu/m2.<br></p><p>Nếu không có nhu cầu mua, có thể đặt vấn đề thuê mặt bằng. Giá thuê và thời hạn thuê thỏa thuận.<br></p><p>Liên hệ: A Hải 0976808868</p><p><br></p>','45000000',1,27,1,1,1311735395,NULL,NULL,62,'A. Hải','Tp Vinh, Nghệ An','0976808868',NULL,'','Bán đất 21m mặt đường Hà Huy Tập','Bán đất 21m mặt đường Hà Huy Tập','Bán đất 21m mặt đường Hà Huy Tập','18.668819','105.67199700000003',231,NULL,NULL,NULL,0,0,231,21,11,'Cần Bán Đất thổ cư Hà Huy Tập, Thành phố Vinh, Nghệ An',NULL,0,0,0,0,NULL,NULL,'','Hà Huy Tập','','10395000000',NULL,10,0,0,0,1,NULL,0),(1066,'BCH1','Bán căn hộ ở chung cư Dầu khí Trường Thi giá rẻ',5,'Căn hộ chung cư',1,'Cần Bán',5,'Giấy tờ hợp lệ',1,'m2',1,'VND',NULL,NULL,NULL,NULL,NULL,48,'Nghệ An',367,'Thành phố Vinh',101,41,'','1-1,1-5,2-6,2-8,2-9,2-11,',NULL,0,'',NULL,NULL,NULL,NULL,'<p>Chung cư Dầu khí Trường Thi là 1 trong những chung cư Hot nhất hiện nay. Cách Quảng Trường HCM 300m, rất thuận tiện cho việc cùng gia đình tản bộ tập thể dục buổi sáng, tối hóng mát thư giãn. Chung cư gần Siêu thị Intermex; Cách trường Tiểu học, Trung học khoảng 400m, gần Chợ...</p><p><br></p><p>Diện tích 68m2, tầng 12, cửa hướng Đông. Có 2 phòng ngủ, 1 khu vệ sinh, 1 phòng khách, 1 phòng ăn.</p><p><br></p><p>Nêu ai có nhu cầu mua xin liên hệ: Anh Hưng: số điện thoại: 0936 271 696<br></p>','12000000',1,33,1,1,1312258000,NULL,NULL,62,'Hưng Béo','Tp Vinh, Nghệ An','0936 271 696',NULL,'','Dầu khí Trường Thi Vinh','Dầu khí Trường Thi Vinh','Dầu khí Trường Thi Vinh','18.667962775273082','105.6930577746216',68,NULL,NULL,NULL,0,0,68,0,0,'Cần Bán Căn hộ chung cư Trần Quang Diệu, Trường Thi, Thành phố Vinh, Nghệ An',NULL,1,1,2,0,NULL,NULL,'','Trường Thi','Trần Quang Diệu','0',NULL,51,0,0,0,1,NULL,0),(1067,'BV110811','Bán đất phường Trường Thi',2,'Nhà tạm',1,'Cần Bán',0,'',1,'m2',1,'VND',NULL,NULL,NULL,NULL,NULL,48,'Nghệ An',367,'Thành phố Vinh',101,47,'Ngõ 1','1-5,2-6,2-8,2-9,2-11,',NULL,1,'Hướng Đông Nam',NULL,NULL,NULL,NULL,