INSERT INTO `iland4_du_an_vi` VALUES (79,' Chung cư cao cấp, nhà ở liền kề Nghi Phú ',' Tòa nhà chung cư số 1, xã Nghi Phú, Tp Vinh, tỉnh Nghệ An ',NULL,NULL,NULL,NULL,' <font style=\"\" face=\"Tahoma\"><span><span><div class=\"clearfix\"><span style=\"font-size: 12px;\" mce_style=\"FONT-SIZE: 12px\"><font style=\"\" face=\"Tahoma\"><span><span><font style=\"\" color=\"#0000ff\"><b> Đặc điểm Công trình:</b> </font><br>-&nbsp;&nbsp;\r\n Hình thức đầu tư: Dự án sẽ được đầu tư theo hình thức đầu tư xây dựng \r\nmới, đồng bộ hệ thống hạ tầng kỹ thuật nhằm hình thành nên một khu đô \r\nthị hiện đại;<br>-&nbsp;&nbsp; Hình thức quản lý dự án: Chủ đầu tư trực tiếp quản lý dự án;<br>-&nbsp;&nbsp; Vị trí địa lý: Vị trí xây dựng Dự án “Tổ hợp dịch vụ, chung cư cao cấp, văn phòng và nhà ở liền kề” nằm trên địa bàn x</span></span><span><span>ã</span></span> <span><span>Nghi Phú - Thành phố Vinh. Khu đất có tổng diện tích là 12.975m2;<br>·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Phía bắc:&nbsp;&nbsp;&nbsp; Giáp đường quy hoạch N1 (rộng 72m);<br>·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Phía Đông: Giáp đường quy hoạch 24m và đất quy hoạch công cộng;<br>·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Phía Nam:&nbsp; Giáp khu dân cư và đường quy hoạch 12m;<br>·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Phía tây:&nbsp;&nbsp;&nbsp; Giáp khu dân cư và đường quy hoạch rộng 12m.</span></span></font></span></div>\r\n<div style=\"text-align: center;\" mce_style=\"text-align: center;\" class=\"clearfix\"><img alt=\"Sơ đồ\" src=\"http://cC7.upanh.com/24.939.32062406.T3J0/sodo.png\" mce_src=\"http://cC7.upanh.com/24.939.32062406.T3J0/sodo.png\"></div><div class=\"clearfix\"><br></div><div class=\"clearfix\"><span style=\"font-size: 12px;\" mce_style=\"font-size: 12px;\"><font style=\"\" face=\"Tahoma\"><span><span><span style=\"font-size: 12px;\" mce_style=\"font-size: 12px;\"><font style=\"\" face=\"Tahoma\"><span><span><span><span><b><font style=\"\" color=\"#0000ff\"> Quy mô đầu tư, bao gồm:<br></font></b>-&nbsp;&nbsp; Tòa nhà 1: Diện tích khu đất 1.032,65 m2; Mật độ xây dựng: 70,6%; Tổng diện tích sàn 7.600m2;<br>-&nbsp;&nbsp; Tòa nhà 2: Diện tích khu đất 982 m2; Mật độ xây dựng: 74,2%; Tổng diện tích sàn 7.800m2;<br>-&nbsp;&nbsp;\r\n Nhà ở liền kề kết hợp Thương mại: Số lượng 16 cái; Diện tích khu đất 96\r\n m2; Mật độ xây dựng: 90%; Tổng diện tích sàn 1.536m2;<br>-&nbsp;&nbsp; Nhà ở kiểu biệt thự: Số lượng 08 cái; Diện tích khu đất 168 m2; Mật độ xây dựng: 71%; Tổng diện tích sàn 1.344m2;<br>-&nbsp;&nbsp; Nhà kiểu liền kề 1: Số lượng 35 cái; Diện tích khu đất 128 m2; Mật độ xây dựng: 75%; Tổng diện tích sàn 4.472m2;<br>-&nbsp;&nbsp; Nhà kiểu liền kề 2: Số lượng 04 cái; Diện tích khu đất 120 m2; Mật độ xây dựng: 75%; Tổng diện tích sàn 528m2.</span></span></span></span></font></span></span></span></font></span></div><div class=\"clearfix\"><br></div><div style=\"text-align: center;\" mce_style=\"text-align: center;\" class=\"clearfix\"><img alt=\"Phối cảnh 2\" src=\"http://cC3.upanh.com/24.939.32062402.cOV0/phoicanh2.png\" mce_src=\"http://cC3.upanh.com/24.939.32062402.cOV0/phoicanh2.png\"></div><div style=\"text-align: center;\" mce_style=\"text-align: center;\" class=\"clearfix\"><br></div><div style=\"text-align: center;\" mce_style=\"text-align: center;\" class=\"clearfix\"><br></div><div style=\"text-align: center;\" mce_style=\"text-align: center;\" class=\"clearfix\"><img alt=\"Căn hộ điển hình loại A\" src=\"http://cC1.upanh.com/24.939.32062400.Vry0/canhodienhinhloaia.png\" mce_src=\"http://cC1.upanh.com/24.939.32062400.Vry0/canhodienhinhloaia.png\"></div></span></span></font><div style=\"text-align: center;\" mce_style=\"text-align: center;\"><font style=\"\" face=\"Tahoma\"><span><span><div class=\"clearfix\"><b>Căn hộ điển hình loại A</b></div><div class=\"clearfix\"><br></div><div class=\"clearfix\"><br></div><div class=\"clearfix\"><img alt=\"Căn hộ điển hình loại B\" src=\"http://cC2.upanh.com/24.939.32062401.Axm0/canhodienhinhloaib.png\" mce_src=\"http://cC2.upanh.com/24.939.32062