; Tầng thượng: 90 m2.<br><b></b></p><p><br></p><p><b>* Khu biệt thự: </b></p><p>Diện tích đất xây dựng: 2.541,5 m2; Diện tích sân vườn: 2.267,14 m2. Tổng diện tích sàn xây dựng: 9.464,5 m2.<br><b></b></p><p><br></p><p><b>* Khu nhà văn hóa, nhà trẻ</b><br><b></b></p><p><br></p><p><b>* Bãi đỗ xe</b></p><p><br></p><p><b>* Cây xanh, giao thông nội bộ</b></p><p><br></p><p><br></p><p style=\"text-align: center;\" mce_style=\"text-align: center;\"><img alt=\"phoi_canh_4\" src=\"http://ngheanland.vn/images/stories/phoi_canh_4.jpg\" mce_src=\"images/stories/phoi_canh_4.jpg\" height=\"458\" width=\"600\"></p><p><br></p><div style=\"text-align: center;\" mce_style=\"text-align: center;\"><b>Sơ đồ mặt bằng</b></div><div style=\"text-align: center;\" mce_style=\"text-align: center;\"><br></div><div style=\"text-align: center;\" mce_style=\"text-align: center;\"><img alt=\"phoi_canh_1\" src=\"images/stories/phoi_canh_1.jpg\" mce_src=\"images/stories/phoi_canh_1.jpg\" height=\"479\" width=\"600\"></div><div style=\"text-align: center;\" mce_style=\"text-align: center;\"><b>Phối cảnh tổng thể</b></div><div style=\"text-align: center;\" mce_style=\"text-align: center;\"><br></div><div style=\"text-align: center;\" mce_style=\"text-align: center;\"><img alt=\"phoi_canh_2\" src=\"images/stories/phoi_canh_2.jpg\" mce_src=\"images/stories/phoi_canh_2.jpg\" height=\"479\" width=\"600\"></div><div style=\"text-align: center;\" mce_style=\"text-align: center;\"><br></div><div style=\"text-align: center;\" mce_style=\"text-align: center;\"><img alt=\"phoi_canh_55\" src=\"images/stories/phoi_canh_55.jpg\" mce_src=\"images/stories/phoi_canh_55.jpg\" height=\"504\" width=\"600\"></div><div style=\"text-align: center;\" mce_style=\"text-align: center;\"><br></div><div style=\"text-align: center;\" mce_style=\"text-align: center;\"><img alt=\"biet_thu2\" src=\"images/stories/biet_thu2.jpg\" mce_src=\"images/stories/biet_thu2.jpg\" height=\"459\" width=\"600\"></div><br><br> ',' Tổng vốn đầu tư lên đến gần 800 tỷ, dự án khẳng định thương hiệu, uy tín của Tổng công ty Hợp tác kinh tế tại Nghệ An. ',' 10/2011 ',' 2013 ','  ','  ',' Tổng Công ty Hợp tác kinh tế COECCO ','  ','  ','  ','  ','  ',31,1,1,NULL,NULL,NULL,NULL,6,' Tổ hợp ',NULL,' <img alt=\"phoi_canh_4\" src=\"http://ngheanland.vn/images/stories/phoi_canh_4.jpg\" mce_src=\"images/stories/phoi_canh_4.jpg\" height=\"533\" width=\"699\"> ',' <br mce_bogus=\"1\"> ',' <br mce_bogus=\"1\"> ',NULL,0,NULL,NULL,'  ','  ','  ',' <img alt=\"phoi_canh_2\" src=\"http://ngheanland.vn/images/stories/phoi_canh_2.jpg\" mce_src=\"images/stories/phoi_canh_2.jpg\" height=\"524\" width=\"657\"> ',' <br mce_bogus=\"1\"> ',' <br mce_bogus=\"1\"> ',NULL,NULL,0,NULL,'  ','  ','  ',NULL,2),(83,' Dự án chung cư dầu khí Trường Thi ',' Khối 13 phường Trường Thi, Tp Vinh ',NULL,NULL,NULL,NULL,' <p>Dự án do CTCP Xây dựng dầu khí Nghệ An (PVA) làm chủ đầu tư. Dự án nằm trên khu đất tại trung tâm Tp. Vinh, cách Quảng trường và Công viên trung tâm khoảng 200m do Công ty đang quản lý và sử dụng có tổng diện tích 3.400 m2.<br></p><p><br></p><p style=\"text-align: center;\" mce_style=\"text-align: center;\"><img alt=\"pva-tp_150\" src=\"images/stories/pva-tp_150.jpg\" mce_src=\"images/stories/pva-tp_150.jpg\" height=\"300\" width=\"300\"></p><p><br></p><p>Dự án bao gồm khu nhà ở chung cư, văn phòng cao 14 tầng với tổng diện tích sàn 10.100m2 và 17 lô nhà liền kề có tổng diện tích sàn 6.500 m2. Tổng mức đầu tư khoảng 160 tỷ đồng.<br><br>Dự kiến thời gian bắt đầu thi công vào Quý I năm 2010 và thành sau 12 tháng xây dựng.</p><p><br></p> ',' Dự án do CTCP Xây dựng dầu khí Nghệ An (PVA) làm chủ đầu tư. Dự án nằm trên khu đất tại trung tâm Tp. Vinh, cách Quảng trường và Công viên trung tâm khoảng 200m do Công ty đang quản lý và sử dụng có tổng diện tích 3.400 m2. ',' Quý I năm 2010 ',' Quý IV năm 2011 ','  ','  ',' CTCP Xây dựng dầu khí Nghệ An ','  ','  ','  ','  ','  ',21,1,0,NULL,NULL,NULL,NULL,1,' Căn hộ cao cấp ',NULL,' <br mce_bogus=\"1\"> ',' <br mce_bogus=\"1\"> ',' <br mce_bogus=\"1\"> ',NULL,1,NULL,NULL,'  ','  ','  ',' <br mce_bogus=\"1\"> ',' <br mce_bogus=\"1\"> ',' <br mce_bogus=\"1\"> ',NULL,NULL,0,NULL,'  ','  ','  ',NULL,2),(84,'Chung cư và trung tâm thương mại Vinh PLAZA','Thành phố Vinh, Nghệ An',NULL,NULL,NULL,NULL,'<p>Dự án chung cư và trung tâm thhương mại Vinh Plaza tọa lạc ngay trung tâm, khu đất vàng của thành phố Vinh. Diện tích đất 1970m2. Diện tích xây dựng 18.939m2. Tổng mức đầu tư lên tới132 tỷ đồng. Kến trúc cao 25 tầng, gồm 180 căn hộ và 2.420,8m2 thương mại. Dự kiến hoàn thành và đi vào sử dụng trong năm 2012.</p><p style=\"text-align: center;\"><img alt=\"vinhplaza\" src=\"images/stories/vinhplaza.jpg\" mce_src=\"images/stories/vinhplaza.jpg\" height=\"806\" width=\"570\"></p>','Dự án chung cư và trung tâm thhương mại Vinh Plaza tọa lạc ngay trung tâm, khu đất vàng của thành phố Vinh. Diện tích đất 1970m2. Diện tích xây dựng 18.939m2. Tổng mức đầu tư lên tới 132 tỷ đồng. Kến trúc cao 25 tầng, gồm 180 căn hộ và 2.420,8m2 thương mạ','2010','2012','','','Công ty CP TECCO Miền Trung','','','','','',1,1,1,NULL,NULL,NULL,NULL,6,'Tổ hợp',NULL,'<img alt=\"vinhplaza\" src=\"images/stories/vinhplaza.jpg\" mce_src=\"images/stories/vinhplaza.jpg\" height=\"806\" width=\"570\">','<br mce_bogus=\"1\">','<br mce_bogus=\"1\">',NULL,1,NULL,NULL,'','','','<img alt=\"vinhplaza\" src=\"images/stories/vinhplaza.jpg\" mce_src=\"images/stories/vinhplaza.jpg\" height=\"806\" width=\"570\">','<br mce_bogus=\"1\">','<br mce_bogus=\"1\">',NULL,NULL,0,NULL,'','','',NULL,2),(85,' Chung cư 5 tầng nhà ở xã hội phường Lê Lợi, Tp. Vinh ',' lê Lợi, Tp. Vinh ',NULL,NULL,NULL,NULL,' <p>Dự án thuộc khu dịch vụ tổng hợp và nhà ở xã hội phường lê Lợi, Tp. Vinh. Kiến túc bao gồm 02 nhà ở xã hội với tổng diện tích xây dựng là 1409.64 m2 (704.82 m2 /nhà). Nhà cao 05 tầng với tổng diện tích sàn là 7.048,2 m2, bao gồm 104 căn hộ. Đã kởi công xây dựng tháng 1/2010, dự kiến hoàn thành vào năm 2012.</p><p><br></p><p style=\"text-align: center;\" mce_style=\"text-align: center;\"><img alt=\"w-phoicanhgoc2\" src=\"images/stories/w-phoicanhgoc2.jpg\" mce_src=\"images/stories/w-phoicanhgoc2.jpg\" height=\"409\" width=\"600\"></p><p style=\"text-align: center;\" mce_style=\"text-align: center;\"><br></p><p style=\"text-align: center;\" mce_style=\"text-align: center;\"><img alt=\"slide2\" src=\"images/stories/slide2.jpg\" mce_src=\"images/stories/slide2.jpg\" height=\"450\" width=\"600\"></p> ',' Dự án thuộc khu dịch vụ tổng hợp và nhà ở xã hội phường lê Lợi, Tp. Vinh. Kiến túc bao gồm 02 nhà ở xã hội với tổng diện tích xây dựng là 1409.64 m2 (704.82 m2 /nhà). Nhà cao 05 tầng với tổng diện tích sàn là 7.048,2 m2, bao gồm 104 căn hộ. Đã kởi công x',' 01/2010 ',' 2012 ','  ','  ',' Công ty CP TECCO Miền Trung ','  ','  ','  ','  ','  ',1,1,1,NULL,NULL,NULL,NULL,7,' Dự án khác ',NULL,' <img alt=\"w-phoicanhgoc2\" src=\"http://ngheanland.vn/images/stories/w-phoicanhgoc2.jpg\" mce_src=\"images/stories/w-phoicanhgoc2.jpg\" height=\"307\" width=\"450\"> ',' <br mce_bogus=\"1\"> ',' <br mce_bogus=\"1\"> ',NULL,1,NULL,NULL,'  ','  ','  ',' <img alt=\"slide2\" src=\"http://ngheanland.vn/images/stories/slide2.jpg\" mce_src=\"images/stories/slide2.jpg\" height=\"537\" width=\"716\"> ',' <br mce_bogus=\"1\"> ',' <br mce_bogus=\"1\"> ',NULL,NULL,0,NULL,'  ','  ','  ',NULL,2),(86,' Khu dịch vụ tổng hợp và nhà ở xã hội Hưng Lộc ',' Hưng Lộc, Tp. Vinh, Nghệ An ',NULL,NULL,NULL,NULL,' <p>Dự án tọa lạc tại xã Hưng Lộc, Tp. Vinh, Nghệ An. Quy mô dự án với diện tích 2,65ha gồm 67 lô liền kế, 1 tòa nhà xã hội 5 tầng. 1 tòa nhà thương mại dịch vụ tổng hợp 9 tầng và 1 toà nhà dành cho người thu nhập thấp 7 tầng. Dự án do công ty cổ phần TECCO Miền Trung làm chủ đầu tư, với tổng mức đầu tư lên tới 140 tỷ VND.</p><p><br></p><p style=\"text-align: center;\" mce_style=\"text-align: center;\"><img alt=\"1\" src=\"images/stories/1.jpg\" mce_src=\"images/stories/1.jpg\" height=\"2253\" width=\"580\"></p> ',' Dự án tọa lạc tại xã Hưng Lộc, Tp. Vinh, Nghệ An. Quy mô dự án với diện tích 2,65ha gồm 67 lô liền kế, 1 tòa nhà xã hội 5 tầng. 1 tòa nhà thương mại dịch vụ tổng hợp 9 tầng và 1 toà nhà dành cho người thu nhập thấp 7 tầng. Dự án do công ty cổ phần TECCO ',' 2009 ',' 2011 ','  ','  ',' Dự án do công ty cổ phần TECCO ','  ','  ','  ','  ','  ',12,1,1,NULL,NULL,NULL,NULL,6,' Tổ hợp ',NULL,' <img alt=\"so_do\" src=\"images/stories/so_do.jpg\" mce_src=\"images/stories/so_do.jpg\" height=\"564\" width=\"575\"> ',' <br mce_bogus=\"1\"> ',' <br mce_bogus=\"1\"> ',NULL,1,NULL,NULL,'  ','  ','  ',' <img alt=\"so_do\" src=\"images/stories/so_do.jpg\" mce_src=\"images/stories/so_do.jpg\" height=\"564\" width=\"575\"> ',' <br mce_bogus=\"1\"> ',' <br mce_bogus=\"1\"> ',NULL,NULL,0,NULL,'  ','  ','  ',NULL,2),(87,' Dự án khu đô thị dầu khí Hoàng Mai ',' Thị trấn Hoàng Mai - Quỳnh Lưu - Nghệ An ',NULL,NULL,NULL,NULL,' <p>Ngày 03/11/2010, PVNC đã được UBND Tỉnh Nghệ An cấp cấp giấy chứng nhận đầu tư Dự án Khu đô thị Dầu khí Hoàng Mai tại quyết định số 27121000018.<br>Dự án do PVNC làm chủ đầu tư, được xây dựng tại Thị trấn Hoàng Mai - Quỳnh Lưu - Nghệ An.<br>Mục tiêu của Dự án: Tạo quỹ nhà ở phục vụ tái định cư tại chỗ và giải quyết nhu cầu về nhà ở cho dân cư của Huyện Quỳnh Lưu và các vùng phụ cận.<br>Thời gian hoạt động của Dự án: 50 năm kể từ ngày được cấp Giấy chứng nhận đầu tư.<br>Dự án Khu đô thị Dầu khí Hoàng Mai được hưởng các ưu đãi đầu tư theo các quy định hiện hành của Nhà nước và các chính sách ưu đãi đặc biệt của UBND Tỉnh Nghệ An. </p><p style=\"text-align: center;\" mce_style=\"text-align: center;\"><img alt=\"dothihoangmai\" src=\"images/stories/dothihoangmai.jpg\" mce_src=\"images/stories/dothihoangmai.jpg\" height=\"511\" width=\"615\"></p><p style=\"text-align: center;\" mce_style=\"text-align: center;\"><br></p><p style=\"text-align: left;\" mce_style=\"text-align: left;\"><b>Quy mô Dự án:</b><br>I. Tổng mức đầu tư: 687,646 tỷ đồng.<br>II. Tổng diện tích quy hoạch: 64,40 ha.<br>III. Tiến độ Dự án:<br>- Khởi công xây dựng vào Quý I/2011<br>- Dự án hoàn thành dự kiến trước Quý IV/2015<br><br><b>Bao gồm các hạng mục công trình:</b><br>- Khu ở mới có diện tích 418.095 m2: Nhà ở liền kề 120m2/lô (331 lô); 150m2/lô (811 lô); biệt thự có vườn 240 m2/lô (130 lô) và Nhà ở chung cư cao tầng.<br>- Khu tái định cư tại chỗ có diện tích 47.702 m2.<br>- Khu hành chính: Xây dựng trụ sở UBND phường (xã), trường học, trạm xá có diện tích 138.872 m2.<br>- Khu thương mại dịch vụ (chợ Hoàng Mai mở rộng và chợ Quỳnh Dị) có diện tích 7.529 m2.<br>- Khu công viên, cây xanh, thể thao có diện tích 31.802m2</p><p style=\"text-align: left;\" mce_style=\"text-align: left;\"><br></p><p style=\"text-align: center;\" mce_style=\"text-align: center;\"><img alt=\"hoangmai\" src=\"images/stories/hoangmai.gif\" mce_src=\"images/stories/hoangmai.gif\" height=\"271\" width=\"500\"></p><p style=\"text-align: center;\" mce_style=\"text-align: center;\"><br></p><p style=\"text-align: left;\" mce_style=\"text-align: left;\">Dự án Khu đô thị Dầu khí Hoàng Mai được xây dựng tại Trung tâm Thị trấn Hoàng Mai nơi tập trung dân cư của vùng kinh tế trọng điểm Nam Thanh - Bắc Nghệ. Sau khi Dự án triển khai sẽ giải quyết vấn đề về nhà ở cho chuyên gia, cán bộ, kỹ sư và công nhân đang làm việc tại các Khu công nghiệp Hoàng Mai, Tân Thắng, Đông Hồi,... (Nghệ An) và Nghi Sơn (Thanh Hóa).</p><p style=\"text-align: left;\" mce_style=\"text-align: left;\"><br></p> ',' Ngày 03/11/2010, PVNC đã được UBND Tỉnh Nghệ An cấp cấp giấy chứng nhận đầu tư Dự án Khu đô thị Dầu khí Hoàng Mai tại quyết định số 27121000018. ',' 2011 ',' 2015 ','  ','  ',' Công ty CP Xây dựng Dầu khí Nghệ An ','  ','  ','  ','  ','  ',14,1,1,NULL,NULL,NULL,NULL,2,' Khu đô thị ',NULL,' <br mce_bogus=\"1\"> ',' <br mce_bogus=\"1\"> ',' <br mce_bogus=\"1\"> ',NULL,1,NULL,NULL,'  ','  ','  ',' <br mce_bogus=\"1\"> ',' <br mce_bogus=\"1\"> ',' <br mce_bogus=\"1\"> ',NULL,NULL,0,NULL,'  ','  ','  ',NULL,2),(88,' Chung cư cao tầng CT1A: Điểm nhấn thành Vinh ',' Quang trung - TP. Vinh - Nghệ An ',NULL,NULL,NULL,NULL,' <p>Chung cư CT1A có 19 tầng căn hộ chung cư, 1 tầng hầm, phần đế 2 tầng. </p><p>Tầng hầm có diện tích 986m2, chiều cao 2,7m dùng để xe và các phòng kỹ thuật như điện nước. </p><p>Tầng 1 và tầng 2 khối đế công trình, diện tích 1.080m2, chiều cao tầng 1 là 4,5m, tầng 2 là 3,9m dùng làm cửa hàng thương mại, siêu thị, văn phòng cho thuê. </p><p>Tầng 3 trở lên bố trí căn hộ ở. Mỗi tầng có 8 căn hộ, trong đó 4 căn hộ loại A diện tích 94m2, 2 căn hộ loại B diện tích 73m2, 2 căn hộ loại C diện tích 66,5m2. </p><p><br></p><p style=\"text-align: center;\" mce_style=\"text-align: center;\"><img alt=\"ct1a\" src=\"images/stories/ct1a.jpg\" mce_src=\"images/stories/ct1a.jpg\" height=\"450\" width=\"349\"></p><p><br></p><p>Tại trung tâm các tầng là nút giao thông đứng với 1 thang bộ và 3 buồng thang máy kết hợp với sảnh tầng. Ngoài ra còn có 1 phòng kỹ thuật, phòng thu rác và 1 thang thoát hiểm, hành lang giao thông các tầng được thiết kế rộng 1,9m, hệ thống chiếu sáng tốt, thông gió tự nhiên. Nguồn điện cung cấp cho công trình là nguồn 3 pha, 4 dây 380/220V lấy từ trạm biến áp 630KVA được đầu tư tại dự án và lấy từ máy phát điện dự phòng cung cấp cho các phụ tải quan trọng như: Thang máy, chiếu sáng công cộng, bơm nước chữa cháy và sinh hoạt. Nước lấy từ mạng nước sinh hoạt của TP Vinh đưa vào bể ngầm qua hệ thống bơm lên đường ống cấp tới bể nước mái, từ đó qua hệ thống bơm giảm áp cung cấp cho từng tầng. Toàn bộ hệ thống nước thải được thu về xử lý cục bộ bằng bể tự hoại sau đó đưa vào hệ thống cổng thoát. </p><p>Tổng mức đầu tư trên 300 tỷ đồng. Khu chung cư CT1A được xây dựng tại sân bóng C7 Quang Trung. Nơi đây trung tâm TP, giao nhau 2 trục đường lớn Quang Trung và Lê Hồng Phong.</p><p><br></p><p style=\"text-align: center;\" mce_style=\"text-align: center;\"><img alt=\"ct1a2\" src=\"images/stories/ct1a2.jpg\" mce_src=\"images/stories/ct1a2.jpg\" height=\"812\" width=\"600\"></p><p style=\"text-align: center;\" mce_style=\"text-align: center;\"><br></p><p style=\"text-align: center;\" mce_style=\"text-align: center;\"><br></p> ',' Chung cư CT1A có 19 tầng căn hộ chung cư, 1 tầng hầm, phần đế 2 tầng. Tầng hầm có diện tích 986m2, chiều cao 2,7m dùng để xe và các phòng kỹ thuật như điện nước. Tầng 1 và tầng 2 khối đế công trình, diện tích 1.080m2, chiều cao tầng 1 là 4,5m, tầng 2 là ',' 2/1010 ',' 2011 ','  ','  ',' Cty CP Đầu tư và Phát triển nhà Hà Nội số 30 ','  ','  ','  ','  ','  ',16,1,1,NULL,NULL,NULL,NULL,1,' Căn hộ cao cấp ',NULL,' <img alt=\"tp_vinh\" src=\"http://ngheanland.vn/images/stories/tp_vinh.jpg\" mce_src=\"images/stories/tp_vinh.jpg\" height=\"285\" width=\"400\"> ',' <br mce_bogus=\"1\"> ',' <br mce_bogus=\"1\"> ',NULL,1,NULL,NULL,'  ','  ','  ',' <img alt=\"tp_vinh\" src=\"http://ngheanland.vn/images/stories/tp_vinh.jpg\" mce_src=\"images/stories/tp_vinh.jpg\" height=\"285\" width=\"400\"> ',' <br mce_bogus=\"1\"> ',' <br mce_bogus=\"1\"> ',NULL,NULL,0,NULL,'  ','  ','  ',NULL,2),(89,'Trung tâm thương mại và chung cư cao cấp VNF1 - Số 2 Lê Lợi, TP Vinh','Số 2 Lê Lợi, TP Vinh, Nghệ An',NULL,NULL,NULL,NULL,'<p><br></p><p>Dự án bao gồm 01 toà nhà trung tâm thương mại và chung cư cao cấp cao 21 tầng với 1978 m2 diện tích xây dựng, 35. 936 m2 diện tích sàn xây dựng; và các khối nhà liền kề với 451 m2, 1993 m2 tổng diện tích sàn. VNF1 Distribution đã lựa chọn phương án thiết kế của Liên danh Công ty kiến trúc Việt Nam và Công ty APDS Architects với Công ty TNHH tư vấn PTA. Công trình mang kiến trúc đẹp, hiện đại, phát huy lợi thế của địa điểm đầu tư, khai thác tốt tiềm năng sử dụng đất</p><p><br></p><p style=\"text-align: center;\"><img alt=\"vnf11\" src=\"images/stories/vnf11.jpg\" mce_src=\"images/stories/vnf11.jpg\" height=\"768\" width=\"500\"></p><p><br></p><p>Nhìn tổng thể, khối công trình kết hợp với nhau một cách hài hoà, tinh tế; vừa có sự cân bằng giữa các khối công trình, vừa phân khúc chức năng một cách rõ ràng và hết sức hợp lý. Các khối công trình được kết nối với nhau thông qua hệ thống sân đường ngoài trời kéo dài trên mặt đất cũng như hệ thống vườn trên các vị trí mặt đứng công trình, mang thiên nhiên vào trong từng khối nhà, tạo nên không gian “xanh” cho công trình. Đây là một giải pháp hữu hiệu và đặc biệt hợp lý cho quần thể công trình do công trình nằm ở khu vực miền Trung nắng gió và thường có nhiệt độ ngoài trời rất cao vào mùa hè.</p><p><br></p><p style=\"text-align: center;\"><img alt=\"vnf13\" src=\"images/stories/vnf13.jpg\" mce_src=\"images/stories/vnf13.jpg\" height=\"365\" width=\"397\"></p><p><br></p><p>Dự án được xây dựng vừa mang nét kiến trúc hiện đại; có hệ thống hạ tầng kỹ thuật, hạ tầng xã hội đồng bộ sẽ tạo ra một không gian thương mại lớn và hiện đại cho thành phố, đồng thời xây dựng được môi trường sống hiện đại và gần gũi với thiên nhiên, đáp ứng nhu cầu phát triển nhà ở của thành phố.<br><br>Dự kiến, dự án trung tâm thương mại và chung cư cao cấp VNF1 sẽ hoàn thành vào quý IV năm 2012. <br></p>','Dự án bao gồm 01 toà nhà trung tâm thương mại và chung cư cao cấp cao 21 tầng với 1978 m2 diện tích xây dựng, 35. 936 m2 diện tích sàn xây dựng; và các khối nhà liền kề với 451 m2, 1993 m2 tổng diện tích sàn.','21/4/2010','Quý IV năm 2012','','','Công ty Công ty cổ phần Phân phối và Bán lẻ VNF1','','','','','',19,1,1,NULL,NULL,NULL,NULL,6,'Tổ hợp',NULL,'<img alt=\"vnf11\" src=\"images/stories/vnf11.jpg\" mce_src=\"images/stories/vnf11.jpg\" height=\"768\" width=\"500\">','<br mce_bogus=\"1\">','<br mce_bogus=\"1\">',NULL,1,NULL,NULL,'','','','<img alt=\"vnf13\" src=\"images/stories/vnf13.jpg\" mce_src=\"images/stories/vnf13.jpg\" height=\"365\" width=\"397\">','<br mce_bogus=\"1\">','<br mce_bogus=\"1\">',NULL,NULL,0,NULL,'','','',NULL,2),(90,' Tòa tháp đôi dầu khí Nghệ An ',' Số 7 Quang Trung, Tp Vinh, Nghệ An ',NULL,NULL,NULL,NULL,' <p style=\"text-align: justify;\"><br></p><p style=\"text-align: justify;\">Công trình được xây dựng tại số 7 đường Quang Trung - TP Vinh, tỉnh Nghệ An. Chủ đầu tư là Công ty Cổ phần Đầu tư và Thương mại Dầu khí Nghệ An (PVIT), với tổng vốn khoảng 600 tỷ đồng.<br><br>Tòa nhà Dầu khí Nghệ An nằm trên khu đất gần 5.100 m2, diện tích xây dựng khoảng 3.500 m2, với mật độ 69%. Công trình gồm hai tòa tháp, mỗi tháp 27 tầng, với tổng chiều cao 85 m. Trong đó, một tháp được xây dựng làm căn hộ cao cấp, tháp còn lại sử dụng làm văn phòng cho thuê. Phần đế công trình cao 4 tầng chung cho cả hai tòa tháp được sử dụng làm trung tâm thương mại, khu vui chơi giải trí. Công trình có hai tầng hầm sử dụng làm nơi để ôtô, xe máy. Tổng diện tích sàn không kể tầng hầm là khoảng 54.000 m2. </p><div style=\"text-align: justify;\"><br></div><div style=\"text-align: justify;\">Chủ đầu tư: Công ty CP Đầu tư &amp; Thương mại Dầu khí Nghệ An (PVIT).<br></div><p><br>Đơn vị thiết kế: Công ty CP Tư vấn Đầu tư và Thiết kế Xây dựng Việt Nam (CDC).<br><br>Đơn vị thi công: Tổng công ty Xây lắp Dầu khí Nghệ An (PVNC).<br><br>Tổng mức đầu tư: 650 tỷ đồng.</p><br><p style=\"text-align: center;\" mce_style=\"text-align: center;\"><img alt=\"daukhi5\" src=\"images/stories/daukhi5.jpg\" mce_src=\"images/stories/daukhi5.jpg\" height=\"690\" width=\"650\"></p><p style=\"text-align: center;\" mce_style=\"text-align: center;\"><br></p><p style=\"text-align: center;\" mce_style=\"text-align: center;\"><img alt=\"daukhi1\" src=\"images/stories/daukhi1.jpg\" mce_src=\"images/stories/daukhi1.jpg\" height=\"867\" width=\"650\"></p><p><br></p><p><br></p><p><b>Loại căn hộ điển hình</b><br></p><p><br></p><p>Từ tầng 6 đến tầng 24<br></p><p><br></p><p>Các căn hộ có mặt bằng bố trí hợp lý, không gian thoáng đẹp, tiện nghi trong sử dụng. Hệ thống hạ tầng kỹ thuật hiện đại, cung cấp đầy đủ các dịch vụ cho người sử dụng</p><p><br></p><p><b>Loại A:</b><br>Diện tích căn hộ:<br>A = 102 m2 - A1= 102 m2<br>Phòng ngủ: 3<br>Phòng khách: 1<br>Phòng ăn &amp; bếp: 1<br>Phòng tắm: 2<br>Lô gia: 1<br>Khu giặt: 1</p><p style=\"text-align: center;\" mce_style=\"text-align: center;\"><img alt=\"toathapdoican-a\" src=\"images/stories/toathapdoican-a.jpg\" mce_src=\"images/stories/toathapdoican-a.jpg\" height=\"633\" width=\"680\"></p><p style=\"text-align: center;\" mce_style=\"text-align: center;\"><br></p><p><b>Loại B:</b><br>Diện tích căn hộ:<br>B = 127 m2 - B1= 131 m2<br>Phòng ngủ: 3<br>Phòng khách: 1<br>Phòng ăn &amp; bếp: 1<br>Phòng tắm: 2<br>Lô gia: 1<br>Khu giặt: 1</p><p style=\"text-align: center;\" mce_style=\"text-align: center;\"><img alt=\"toathapdoican-b\" src=\"images/stories/toathapdoican-b.jpg\" mce_src=\"images/stories/toathapdoican-b.jpg\" height=\"576\" width=\"680\"></p><p style=\"text-align: center;\" mce_style=\"text-align: center;\"><br></p><p style=\"text-align: left;\" mce_style=\"text-align: left;\"><b>Loại C:</b><br>Diện tích căn hộ:<br>C = 108 m2 - C1= 108 m2<br>Phòng ngủ: 3<br>Phòng khách: 1<br>Phòng ăn &amp; bếp: 1<br>Phòng tắm: 2<br>Lô gia: 1<br>Khu giặt: 1</p><p style=\"text-align: center;\" mce_style=\"text-align: center;\"><img alt=\"toathapdoican-c\" src=\"images/stories/toathapdoican-c.jpg\" mce_src=\"images/stories/toathapdoican-c.jpg\" height=\"542\" width=\"680\"></p><p style=\"text-align: center;\" mce_style=\"text-align: center;\"><br></p><p style=\"text-align: left;\" mce_style=\"text-align: left;\"><b>Loại D:</b><br>Diện tích căn hộ:<br>D = 93,5 m2<br>Phòng ngủ: 3<br>Phòng khách: 1<br>Phòng ăn &amp; bếp: 1<br>Phòng tắm: 2<br>Lô gia: 1<br>Khu giặt: 1</p><p style=\"text-align: center;\" mce_style=\"text-align: center;\"><img alt=\"toathapdoican-d\" src=\"images/stories/toathapdoican-d.jpg\" mce_src=\"images/stories/toathapdoican-d.jpg\" height=\"503\" width=\"680\"></p><p style=\"text-align: center;\" mce_style=\"text-align: center;\"><br></p><p style=\"text-align: left;\" mce_style=\"text-align: left;\"><br></p><div style=\"text-align: left;\" mce_style=\"text-align: left;\"><b>Căn hộ Pendhouse</b><br><b>Tầng 23 đến tầng 24</b><br></div><p style=\"text-align: left;\" mce_style=\"text-align: left;\"><br>Các căn hộ pendhouse được thiết kế như những biệt thự vườn trên mái, hòa cùng cảnh sắc của một vùng sông Lam, núi Hồng. Với không gian thoáng rộng, thiết kế đầy đủ tiện nghi sẽ đem đến cho bạn một nơi ở tuyệt vời nhất<br></p><p style=\"text-align: center;\" mce_style=\"text-align: center;\"><img alt=\"can-penhouse-e\" src=\"images/stories/can-penhouse-e.jpg\" mce_src=\"images/stories/can-penhouse-e.jpg\" height=\"792\" width=\"680\"></p><p style=\"text-align: center;\" mce_style=\"text-align: center;\"><br></p><p style=\"text-align: center;\" mce_style=\"text-align: center;\"><img alt=\"can-penhouse-f\" src=\"images/stories/can-penhouse-f.jpg\" mce_src=\"images/stories/can-penhouse-f.jpg\" height=\"700\" width=\"680\"></p><p style=\"text-align: center;\" mce_style=\"text-align: center;\"><br></p><p style=\"text-align: center;\" mce_style=\"text-align: center;\"><img alt=\"can-penhouse-g\" src=\"images/stories/can-penhouse-g.jpg\" mce_src=\"images/stories/can-penhouse-g.jpg\" height=\"686\" width=\"680\"></p><p style=\"text-align: center;\" mce_style=\"text-align: center;\"><br></p><p style=\"text-align: center;\" mce_style=\"text-align: center;\"><img alt=\"can-penhouse-h\" src=\"images/stories/can-penhouse-h.jpg\" mce_src=\"images/stories/can-penhouse-h.jpg\" height=\"571\" width=\"680\"></p><p style=\"text-align: center;\" mce_style=\"text-align: center;\"><b><br></b></p><p style=\"text-align: left;\" mce_style=\"text-align: left;\"><b>Hệ thống văn phòng cho thuê hiện đại<br>Từ tầng 6 đến tầng 24</b><br><br>Văn phòng cho thuê cao cấp nhất với diện tích đa dạng. Hệ thống an ninh và cơ sở hạ tầng đảm bảo. Lựa chọn gói thuê lâu dài từ 2 đến 68 năm.<br><br>+ Diện tích: 850 m2 một tầng<br>+ Hệ thống camera an ninh<br>+ Hệ thống phòng cháy chữa cháy<br>+ Bảo vệ 24/24<br>+ Thời gian cho thuê: 2 - 68 năm</p><p style=\"text-align: left;\" mce_style=\"text-align: left;\"><br></p><p style=\"text-align: center;\" mce_style=\"text-align: center;\"><img alt=\"vanphongthapdoi-2\" src=\"images/stories/vanphongthapdoi-2.jpg\" mce_src=\"images/stories/vanphongthapdoi-2.jpg\" height=\"694\" width=\"680\"></p><p style=\"text-align: center;\" mce_style=\"text-align: center;\"><br></p><p style=\"text-align: left;\" mce_style=\"text-align: left;\"><b>Khu trung tâm thương mại, giải trí<br>Từ tầng 1 đến tầng 5<br></b><br>+ 50 gian hàng cao cấp tầng 1.<br>+ Hệ thống siêu thị hiện đại tầng 2 đến tầng 4.<br>+ Khu giải trí vui chơi dành cho trẻ em và gia đình ở tầng 5. </p><p style=\"text-align: center;\" mce_style=\"text-align: center;\"><img alt=\"tttm-thapdoi-1\" src=\"images/stories/tttm-thapdoi-1.jpg\" mce_src=\"images/stories/tttm-thapdoi-1.jpg\" height=\"579\" width=\"680\"></p><p style=\"text-align: center;\" mce_style=\"text-align: center;\"><br></p><p style=\"text-align: center;\" mce_style=\"text-align: center;\"><img alt=\"tttm-thapdoi-2\" src=\"images/stories/tttm-thapdoi-2.jpg\" mce_src=\"images/stories/tttm-thapdoi-2.jpg\" height=\"525\" width=\"680\"></p><p style=\"text-align: left;\" mce_style=\"text-align: left;\"><b>Khu Cafe ngắm cảnh<br>Tấng 25</b><br><br>Địa điểm thư giãn lý tưởng với không gian và tầm nhìn xung quanh thoáng, đẹp. Hệ thống Wifi đảm bảo có thể vừa làm việc bên ly cafe. Quán Bar sôi động là nơi giải trí lý tưởng.</p><p style=\"text-align: center;\" mce_style=\"text-align: center;\"><img alt=\"khucaphethapdoi-1\" src=\"images/stories/khucaphethapdoi-1.jpg\" mce_src=\"images/stories/khucaphethapdoi-1.jpg\" height=\"343\" width=\"680\"></p><p style=\"text-align: center;\" mce_style=\"text-align: center;\"><img alt=\"khucaphethapdoi-2\" src=\"images/stories/khucaphethapdoi-2.jpg\" mce_src=\"images/stories/khucaphethapdoi-2.jpg\" height=\"219\" width=\"665\"></p> ',' Công trình được xây dựng tại số 7 đường Quang Trung - TP Vinh, tỉnh Nghệ An. Chủ đầu tư là Công ty Cổ phần Đầu tư và Thương mại Dầu khí Nghệ An (PVIT), với tổng vốn khoảng 600 tỷ đồng. ',' 27/3/2008 ',' 2011 ','  ','  ',' Công ty CP Đầu tư & Thương mại Dầu khí Nghệ An ','  ','  ','  ','  ','  ',27,1,1,NULL,NULL,NULL,NULL,1,' Căn hộ cao cấp ',NULL,' <img alt=\"daukhi1\" src=\"http://ngheanland.vn/images/stories/daukhi1.jpg\" mce_src=\"images/stories/daukhi1.jpg\" height=\"768\" width=\"576\"> ',' <br mce_bogus=\"1\"> ',' <br mce_bogus=\"1\"> ',NULL,1,NULL,NULL,'  ','  ','  ',' <img alt=\"daukhi5\" src=\"http://ngheanland.vn/images/stories/daukhi5.jpg\" mce_src=\"images/stories/daukhi5.jpg\" height=\"637\" width=\"600\"> ',' <br mce_bogus=\"1\"> ',' <br mce_bogus=\"1\"> ',NULL,NULL,0,NULL,'  ','  ','  ',NULL,2);
